import React, { Component } from "react";
import { Card, CardText, CardBody, Button, CardTitle } from "reactstrap";

import Navbar from "../Components/Navbar.js";
import Footer from "../Components/Footer.js";
import Table1 from "../Components/Table1.js";

import "./Home.css";

export default class LoggIn extends Component {
  render() {
    return (
      <div>
        <Navbar />
        <div className="container">
          <h2>Welcome to NoteFinder at NDNU!</h2>

          <div>
            <Card>
              <CardBody>
                <CardTitle>Welcome Michael</CardTitle>
              </CardBody>
              <img
                width="50%"
                src="https://placeholdit.imgix.net/~text?txtsize=33&txt=318%C3%97180&w=318&h=180"
                alt="Card image cap"
              />
              <CardBody>
                <CardText>
                  Some quick example text to build on the card title and make up
                  the bulk of the card's content.
                </CardText>
                <Button>Post it</Button>
              </CardBody>
            </Card>
          </div>

          <Table1 />
          <Footer />
        </div>
      </div>
    );
  }
}
